;; gorilla-repl.fileformat = 1

;; **
;;; # Simple pendulum, with biased grammar
;; **

;; **
;;; Proof-of-principle demonstration of finding the Lagrangian for a simple pendulum. Uses the same score function as the "restricted polynomial" code but has a much larger search space of possible expressions. Uses a grammar biased towards generating Lagrangians for simple physical systems.
;; **

;; @@
(ns flow.runs.pendulum
  (:require [gorilla-plot.core :as plot]
            [algebolic.expression.core :as expression]
            [algebolic.expression.genetics :as genetics]
            [algebolic.expression.tree :as tree]
            [algebolic.expression.score :as score]
            [algebolic.expression.render :as render]
            [algebolic.expression.mma :as mma]
            [darwin.evolution.core :as evolution]
            [darwin.evolution.metrics :as metrics]
            [darwin.evolution.transform :as transform]
            [darwin.algorithms.spea2 :as spea2]
            [flow.lagrangian :as lagrangian]
            [flow.util :as util]
            [runs.config :as config]
            [runs.util :as rutil]
            [semantic-csv.core :as csv]
            [clojure.walk :as walk]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Load the data exported from Mathematica.
;; **

;; @@
(def dat (mapv #(vector (first %))
               (csv/slurp-csv "data/mma_pendulum_large.csv"
                              :header false
                              :cast-fns {0 #(Double/parseDouble %) 1 #(Double/parseDouble %)})))
(def t-step 0.1)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;flow.runs.pendulum/t-step</span>","value":"#'flow.runs.pendulum/t-step"}
;; <=

;; @@
(plot/list-plot (mapv first dat))
